	(105, 0, '105', '你好 是简介', 'https://img.jj59.com/6/5a717afb6f4b.jpg;http://www.pptbz.com/pptpic/UploadFiles_6909/201203/2012031220134655.jpg;http://uploads.oh100.com/allimg/1709/117-1FZ5102542-52.jpg', '<div class="picurl" style="border: 0px; margin: 10px 0px 0px; padding: 0px; color: rgb(51, 51, 51); font-family: Arial, "><img src="/ueditor/jsp/upload/image/20190312/1552382389018055985.jpg"/></div><p style="border: 0px; margin-top: 0px; margin-bottom: 1em; padding: 0px; text-indent: 2em; color: rgb(51, 51, 51); font-family: Arial, "><br/></p><p style="border: 0px; margin-top: 0px; margin-bottom: 1em; padding: 0px; text-indent: 2em; color: rgb(51, 51, 51); font-family: Arial, ">　　叠几行落叶随风的小字，停泊指尖，于心的宁静中，藏一掬思念，轻轻落凡尘。这点滴的心思，汇聚在无声的雨里，捎去遥远的梦想，寻思着，这花香烟火，一沓沓，恰好可以，恰好能够，落入相逢的城池。<br/>　　<br/>　　总想着，即便是散落天涯的尘埃，也能挥着隐形的翅膀，如童话故事那般，随缘晾晒，把盏岁月。风飞舞流年窗台，挺暖地，在装满阳光的细碎往事中，掀开喜爱的页脚，于最美的时光，流泻厚实的线条，写意几笔，诗行几句，小日子里的小心情，挺好的！<br/>　　<br/>　　一粒烟火，一沓花香，几步清影，几度夕阳红，安心地，在一方种满欢喜的小院子，心无杂念，等黎明的曙光，等未曾谋面的缘份，于遥远时空中，踏月而来。只是简单着，再简单的，等一朵花，开了；待一滴细雨，醉了，自由自在于一抹清风徐来之时，数一枚枚心事，打开一叠一叠的似水年华，让生命入住烟火。<br/>　　<br/>　　向来喜欢浅淡的颜色，小巧玲珑的植物，略有年代的物件，就如一直专注一个字，一句话，一沓又一沓的花香，沾着一点烟火的味道，有些清明，有些温润，轻轻微微惠临身旁。带着那么一点的忧思，合着小小的愿望，组合一方，只是恰好入了心情，醉了心意，而已。<br/>　　<br/>　　如此美好在，种下的花香绿植里，自行诗意抽花，或许一直未曾花开，只是绿意盎然了，一方院子，一窗台阳光，也挺好。在灯火阑珊处，为夕阳谱写了，一卷春生的愿望；为平凡的生活，点缀了一响欢颜，一道风景，专属着一种味道，让日子生香。<br/>　　<br/>　　当经过了烟火半生，回望那年那月，一季初夏的花开，也曾相识相知，欢喜写意，扣字书信，折香间。在成长的路程上，远了谁的记忆？隔断谁的初心？总是在回忆的一方小盒子里，翻阅时光太瘦的答案，却未能解读，戏如人生的轮换。<br/>　　<br/>　　也许烟火的季节，本是交替着的美丽，没有一如当初，一如往昔，都是不断追逐黎明，相互暗换，不同的面孔，不同的人事布局。黑白棋子，交替落下，没有始终的人生赢家，有的只是看待的角度。<br/>　　<br/>　　想来，想去，曾经落款的故事，烙印在一方格子间，而这烟火人生，不过是，格子间的一沓沓的花香串联，我闻到了，踏马来到这，有了一段时光，花开花落了一墙角花月。<br/>　　<br/>　　花香烟火，一沓沓，邻水静坐数光阴，一朵忧，一瓣喜，从容迎来，淡然相送。生活的过场，简单而细致，斟酌各种况味，叠加人生的角角落落，一些彩绘，一点点的浅妆，厚重着一双手，去温暖忽而之间的薄凉。<br/>　　<br/>　　岁月缝花，时光煮雨，萌生些葱茏，盛放些欢喜，于生命绿圃，让花香烟火，一沓沓，随心而来，随缘而去，不论如何，一枚温善深情，不负你我，不负生命，就好！<br/>　　<br/>　　文落梅雪舞</p><p><br/></p>', 105, '2019-03-12 18:05:22', '2019-03-12 17:26:46', '武海升', '1');
